def Match(text):
    if not isinstance(text, (list, tuple, str)):
        raise TypeError("text must be a sequence of characters")
    s = ''.join(text)
    n = len(s)
    if n == 0:
        return ['N', 'o']
    i = 0
    # Match one or more uppercase letters at the start
    while i < n and 'A' <= s[i] <= 'Z':
        i += 1
    if i == 0:
        return ['N', 'o']
    # Match one or more lowercase letters at the end
    j = i
    while j < n and 'a' <= s[j] <= 'z':
        j += 1
    if j == n and (n - i) >= 1:
        return ['Y', 'e', 's']
    else:
        return ['N', 'o']
```

