def CheckTypeOfTriangle(a: int, b: int, c: int) -> str:
    # Precondition: a, b, c must be positive integers and form a valid triangle
    if not (isinstance(a, int) and isinstance(b, int) and isinstance(c, int)):
        raise TypeError("Sides must be integers")
    if a <= 0 or b <= 0 or c <= 0:
        raise ValueError("Sides must be positive integers")
    # Triangle inequality
    if a + b <= c or a + c <= b or b + c <= a:
        raise ValueError("Sides do not form a valid triangle")
    # Sort sides so that c is the largest
    sides = sorted([a, b, c])
    x, y, z = sides  # x <= y <= z
    sqa, sqb, sqc = x * x, y * y, z * z
    if sqa + sqb == sqc:
        return "Right-angled Triangle"
    elif sqa + sqb < sqc:
        return "Obtuse-angled Triangle"
    else:
        return "Acute-angled Triangle"
